import { FC } from 'react';
import { Form } from 'antd';

export const Login: FC = () => {
  return(
    <div className={'container'}>
      <Form
      name = "basic"
      labelCol={{
        span: 8,
      }}
      >
        <Form.Item
          label = "Name"
          name = "name"
          rules={[
            {
              required: true,
              message: "Укажите логин",
            }
          ]}
        >

        </Form.Item>
      </Form>
    </div>
  )
}
